// Logo.js
import React from 'react';
import './logo.module.css';  // Importe o arquivo CSS aqui
import logo from '../../Images/Logo.png';

function Logo() {
  return (
    <div className='logo'>
      <p className='logo-text'><strong>B</strong>ooks</p>
      <img src={logo} alt="logo" className='logo-img' />
    </div>
  );
}

export default Logo;
